import React, { useState } from "react";
import { Card, CardHeader, CardBody, FormGroup, Form, Input, Row, Col, Button, Alert } from "reactstrap"; // Importación de componentes de Reactstrap
import PanelHeader from "components/PanelHeader/PanelHeader.js"; // Importación de un componente personalizado
import { agregarCupon } from "../services/apiCupones.js"; // Importación de la función agregarCupon desde el servicio API

function AgregarCupon() {
  // Definición de estados para manejar el formulario y mensajes de alerta
  const [codigo, setCodigo] = useState(""); // Estado para el código del cupón
  const [porcentajeDescuento, setPorcentajeDescuento] = useState(""); // Estado para el porcentaje de descuento del cupón
  const [descuentoMinimo, setDescuentoMinimo] = useState(""); // Estado para el descuento mínimo del cupón
  const [alertVisible, setAlertVisible] = useState(false); // Estado para la visibilidad de la alerta
  const [alertMessage, setAlertMessage] = useState(""); // Estado para el mensaje de la alerta
  const [alertColor, setAlertColor] = useState("success"); // Estado para el color de la alerta

  // Función que se ejecuta al enviar el formulario
  const handleSubmit = async (e) => {
    e.preventDefault(); // Prevenir el comportamiento predeterminado del formulario

    try {
      // Crear un objeto con los datos del nuevo cupón
      const nuevoCupon = { codigo, porcentajeDescuento, descuentoMinimo };
      // Llamar a la función agregarCupon del servicio API para agregar el nuevo cupón
      const respuesta = await agregarCupon(nuevoCupon);

      console.log("Cupón agregado:", respuesta);

      // Reiniciar los valores del formulario y mostrar un mensaje de éxito
      setCodigo("");
      setPorcentajeDescuento("");
      setDescuentoMinimo("");

      setAlertMessage("Cupón agregado exitosamente");
      setAlertColor("success");
      setAlertVisible(true);
    } catch (error) {
      // En caso de error, mostrar un mensaje de error
      console.error("Error al agregar cupón:", error);

      setAlertMessage("Error al agregar cupón");
      setAlertColor("danger");
      setAlertVisible(true);
    }
  };

  // Renderizado del componente
  return (
    <>
      <PanelHeader size="sm" /> {/* Encabezado del panel */}
      <div className="content">
        <Row>
          <Col md="8">
            <Card>
              <CardHeader>
                <h5 className="title">Agregar Cupón</h5> {/* Título del formulario */}
              </CardHeader>
              <CardBody>
                {/* Alerta para mostrar mensajes de éxito o error */}
                {alertVisible && (
                  <Alert color={alertColor} isOpen={alertVisible} toggle={() => setAlertVisible(false)}>
                    <span>
                      <b>{alertColor === "success" ? "Success - " : "Danger - "}</b>
                      {alertMessage}
                    </span>
                  </Alert>
                )}
                {/* Formulario para agregar un nuevo cupón */}
                <Form onSubmit={handleSubmit}>
                  <Row>
                    {/* Campo para ingresar el código del cupón */}
                    <Col className="pr-1" md="6">
                      <FormGroup>
                        <label>Código</label>
                        <Input
                          value={codigo}
                          onChange={(e) => setCodigo(e.target.value)}
                          placeholder="Código"
                          type="text"
                          required
                        />
                      </FormGroup>
                    </Col>
                    {/* Campo para ingresar el porcentaje de descuento del cupón */}
                    <Col className="pl-1" md="6">
                      <FormGroup>
                        <label>Porcentaje de Descuento</label>
                        <Input
                          value={porcentajeDescuento}
                          onChange={(e) => setPorcentajeDescuento(e.target.value)}
                          placeholder="Porcentaje de Descuento"
                          type="number"
                          required
                        />
                      </FormGroup>
                    </Col>
                  </Row>
                  {/* Campo para ingresar el descuento mínimo del cupón */}
                  <Row>
                    <Col md="12">
                      <FormGroup>
                        <label>Descuento Mínimo</label>
                        <Input
                          value={descuentoMinimo}
                          onChange={(e) => setDescuentoMinimo(e.target.value)}
                          placeholder="Descuento Mínimo"
                          type="number"
                          required
                        />
                      </FormGroup>
                    </Col>
                  </Row>
                  {/* Botón para enviar el formulario */}
                  <Button type="submit" color="primary">Agregar Cupón</Button>
                </Form>
              </CardBody>
            </Card>
          </Col>
        </Row>
      </div>
    </>
  );
}

export default AgregarCupon;
